import React, { Component } from 'react'

class Main extends Component {
    render() {
        return(
            <div className='text-center'>
                <h1>ZONGDAO</h1>
                <button type="button" onClick={this.handleSubmit}>invest</button>

            </div>
            
        )

        

    }
}

export default Main;
